import React, { Component } from 'react';
import { Button, ButtonLink, ArrowButton, CloseButton } from '../../reusable/button';
import './viewer.css';

class Viewer extends Component {
    render() {
        return (
            <>
                <p>Viewer</p>
                <CloseButton />
            </>
        )
    }
}

export default Viewer;
